const orderManager = [
  {
    path: '/sale/order',
    name: 'order',
    component: () => import('@/views/sale/orderList/Order.vue')
  },
  {
    path: '/order/dispatch',
    name: 'dispatchOrder',
    component: () => import('@/views/sale/dispatchOrder/dispatch.vue')
  },
  {
    path: '/order/purchase',
    name: 'purchase',
    component: () => import('@/views/sale/purchase/purchase.vue')
  }
]

export default orderManager
